return {
    version: "1",
    disableDraw: function () {
        return true;
    },
    supported: {
        visualType: "table"
    },
    afterDraw: function () {
        var data = arcapi.dataResult();
        var columns = data.columns(); // all data columns
        var rows = data.rows(); // all data rows
        var $chart = $("#" + arcapi.chartId()); // the div for drawing the chart
        var $table = $('<table class="simple-table" id="ver_table">'); // the div for drawing the chart
        var dimIdx = data.dim_start_idx();
        var aggStartIdx = data.agg_start_idx();
        var aggEndIdx = data.agg_end_idx();
        var $header = $("<thead>");
        //var $img;
        if (rows.length == 0) {
            console.log("empty image");
            var $img = $('<img id="perimg" style="width:50%; height:50%;" src="blank">');
        }
        else {
            var $img = $('<img id="perimg" style="width:50%; height:50%;" src="data:image/png;base64,'+rows[0][0]+'">');
            console.log("some image"+rows[0][0]);
        }

        var $headerRow = $("<tr>");
        var $body = $("<tbody>");
        var tableRows = {};

        if (dimIdx === data.dim_end_idx()) {

            if ($("#ver_table").length > 0 ){
                $("#ver_table").remove();
                $("#perimg").remove();
            }


            $chart.append($img);
            $chart.append($table);
            $table.append($header);
            $header.append($headerRow);
            $headerRow.append(makeHeaderCell("Measures"));
            $table.append($body);
            rows.forEach(function(columnValues, colIdx) {

                columnValues.forEach(function(rowValue, rowIdx){
                    if (rowIdx >= aggStartIdx+1 && rowIdx <= aggEndIdx ) {
                        var $row;
                        if (tableRows[rowIdx]) {
                            $row = tableRows[rowIdx];
                        } else {
                            $row = $("<tr>");
                            tableRows[rowIdx] = $row;
                            $body.append($row);
                            $row.append(makeHeaderCell(columns[rowIdx].colname()));
                        }
                        $row.append(makeCell(rowValue));
                    }
                });
                $headerRow.append(makeHeaderCell(columnValues[dimIdx]))

            });

            // arcl.dataTable = arc.misc.DataTable($table, {});
        } else {
            console.log("Only 1 dimension allowed");
        }

        function makeHeaderCell(cellValue) {
            return "<th>" + cellValue + "</th>"
        }
        function makeCell(cellValue) {
            return "<td>" + cellValue + "</td>"
        }
    },
};

