/*
 * Within an appgroup, add in the ability to click on a visual to navigate to
 * a different app within the appgroup.
 */

return function() {
    var f = function() {};

    f.version = '1';

    f.settings = function() {
        return [
            {
                id: 'App to navigate to',
            },
        ];
    };

    f.afterDraw = function() {
        var lib = arcapi.unsupportedDriver;
        var $sel = $('#' + arcapi.chartId());
        // console.log($sel);

        var appId = arcapi.getSetting('App to navigate to');
        appId = +appId;
        if (!appId) {
            return;
        }

        $('#' + arcapi.chartId() + ' .dataTables_scrollBody table tr td:nth-child(2)')
            .off('click')
            .on('click', function() {
                console.log('clicked', arc.globals.appgroup, arc.globals.reports);
                var ip = $(this).text();
                if (arc.globals.appgroup) {
                    if (arc.globals.reports) {
                        //$('#tooltip').css('display', 'none');

                        var params = arc.globals.reports.params();
                        params.add({
                            key: 'search',
                            value: 'src_ip4:' + ip,
                            source_visual_id: lib.report_id(),
                        });
                    }

                    console.log('Navigating to app', appId);
                    arc.globals.appgroup.navigateToApp(appId);
                } else {
                    console.log('In appgroup mode, would navigating to app', appId);
                }
            });
    };

    return f;
}();

