return function() {

    var f = function() {};

     f.version = "1";

    f.settings = function() {
        return [
        {
            id: 'Widget name',
            value: 'kpi1',
        },
        {
            id: 'Widget style',
            value: 'storage',
        },

        ];
    };

    //Disable drawing of any visual - lines / bars / pie charts...
    f.disableDraw = function() {
        return true;
    };


    //Create own custom drawing / visual
    f.afterDraw = function() {

        // Get the results back from the database query
        var rows = arcapi.dataResult().rows();
        var viz_name = arcapi.getSetting('Widget name');
        var widget_type = arcapi.getSetting('Widget style');


        //if (rows.length === 0) {
        //    return;
        //}

        //var row = rows[0];
        //var metric1 = +row[0]; //;

        var $sel = $('#' + arcapi.chartId());

        var replacements;
        var df;

        $sel.find('#'+viz_name).remove();

        switch(widget_type) {
            case "clock":
                if (rows.length !== 0) {
                    var row = rows[0];
                    df = d3.format(".3s");
                    var hour = df(+row[0]/3600);
                    var minute = df((+row[0]%3600)/60);

                }
                else {
                    var hour = '-';
                    var minute = '-';
                }
                replacements = {
                    NAME: viz_name,
                    HOUR: hour,
                    MINUTE: minute,
                };


                console.log(f.html_clock, replacements);
                $sel.append(arc.misc.safe_substitute(f.html_clock, replacements));
                break;
            case "storage":
                if (rows.length !== 0) {
                    var data = rows;
                    total = d3.sum(data, function(d) { return +d[1]; });
                    df = d3.format(".2s");
                    var metric1 = df(total);
                }
                else
                    var metric1 = 'N/A';
                replacements = {
                    NAME: viz_name,
                    METRIC: metric1,
                };


                $sel.append(arc.misc.safe_substitute(f.html_storage, replacements));
                break;
            default: 
                if (rows.length !== 0) {
                    var row = rows[0];
                    var df = d3.format(".1f");
                    var pass = df(+row[0]);
                }
                else {
                    var pass = 'N/A';
                    var date = '-';
                    var time = '-';
                }

                replacements = {
                    NAME: viz_name,
                    PASS: pass,
                    DATE: date,
                    TIME: time,
                };


                $sel.append(arc.misc.safe_substitute(f.html_runstatus, replacements));
        }
        //$sel.append(arc.misc.safe_substitute(f.html, replacements));

    };

    f.html_clock = ' \
    <div id="%NAME%" class="obj-overview-box"> \
      <div class="obj-icon-wrapper"><i class="fa fa-clock-o"></i></div> \
      <div class="obj-number-wrapper"> \
        <span class="obj-number">2</span> \
        <span class="obj-label">hr</span> \
        <span class="obj-number">52</span> \
        <span class="obj-label">min</span>  \
      </div>  \
    </div>  \
    ';

    f.html_storage = ' \
    <div id="%NAME%" class="obj-overview-box views"> \
       \
      <div class="obj-number-wrapper"> \
        <span class="obj-label"><i class="fa fa-shield"></i>  Total Events</span> \
        <div class="obj-number">%METRIC%</div> \
      </div> \
    </div> \
    ';

    f.html_runstatus = ' \
    <div id="%NAME%" class="obj-overview-box"> \
      <span class="badge-success"><i class="fa fa-check"></i></span> \
      <div class="obj-icon-wrapper"><i class="fa fa-shield"></i></div> \
      <div class="obj-number-wrapper"> \
        <span class="obj-number">%PASS%</span> \
        <span class="obj-label">Pass</span> \
      </div> \
      <div class="obj-number-wrapper-right"> \
        <span class="obj-number-sm">%DATE%</span> \
        <span class="obj-number-sm">%TIME%</span> \
      </div> \
    </div> \
    ';

    console.log('data', f.html_clock)

    return f;
}();

